import "./Navbar.css"
import Home from './Components/Home/Home';
import About from './Components/About/About';
import IceCream from './Components/IceCream/IceCream';


function Navbar() {
    const [currentPage, setCurrentPage] = useState('home'); // State to track the current page

    // Render the appropriate page component based on the current page state
    const renderPage = () => {
      switch (currentPage) {
        case 'home':
          return <Home />;
        case 'about':
          return <About />;
        case 'icecream':
          return <IceCream />;
        default:
          return <Home />;
      }
    };

    return (
        <nav class="taskbar">
            <ul>
                <li><a href="HDMain.html">Home</a></li>
                <li><a href="IceCream.html">Flavors</a></li>
                <li><a href="catering.html">Catering Services</a></li>
                <li><a href="about.html">About</a></li>
                {/*<!--Add more links as needed-->*/}
            </ul>
        </nav>
    );


}

export default Navbar;
